import React from "react"
import "./index.scss"
import {Col, Container} from "react-bootstrap";

export default function Index() {
    return (
        <Container>
            <Col xs={12}>
                <h1>2019 Novel Coronavirus (2019-nCoV)</h1>
            </Col>
            <Col md={6}>
                <h1>Chart 1</h1>
            </Col>
        </Container>
    )
}
